import { connect } from "react-redux";

class SquareOfCheckboxTable extends Component {
  render() {
    return <div></div>;
  }
}

let mapStateToProps = (state) => {
  let chair = state.chairList.map((chair, key) => ({
    chair,
    key,
  }));
  console.log(chair.danhSachGhe);
  return {
    seatsInput: state,
  };
};

export default connect(mapStateToProps)(SquareOfCheckboxTable);
